import React, { Component } from "react";
import UserDTOService from "../../services/UserDTOService";
import FindJasuView from "../../components/view/users/FindJasuView";

export default class UserControl extends Component {
  constructor(props) {
    super(props);
    this.state = {
      userDTOs: [],
    };
  }
  componentDidMount() {
    UserDTOService.getUsers().then((res) => {
      this.setState({
        userDTOs: res.data,
      });
    });
  }

  render() {
    return (
      <div className="findJasu">
        <FindJasuView userList={this.state.userDTOs} />
      </div>
    );
  }
}
